func TestSignPreHash44(t *testing.T) {
	for _, c := range sigGenPreHash44InternalProjectionCases {
		sk, _ := hex.DecodeString(c.sk)
		pk, _ := hex.DecodeString(c.pk)
		sig, _ := hex.DecodeString(c.sig)
		msg, _ := hex.DecodeString(c.message)
		context, _ := hex.DecodeString(c.context)
		priv, err := NewPrivateKey44(sk)
		if err != nil {
			t.Fatalf("NewPrivateKey44 failed: %v", err)
		}
		sig2, err := priv.SignPreHash(zeroReader, msg, context, c.oid)
		if err != nil {
			t.Fatalf("failed to sign: %v", err)
		}
		if !bytes.Equal(sig2[:32], sig[:32]) {
			t.Errorf("signature mismatch(signer's commitment hash): got %x, want %x", sig2[:32], sig[:32])
		}
		if !bytes.Equal(sig2[32:32+encodingSize18*l44], sig[32:32+encodingSize18*l44]) {
			t.Errorf("signature mismatch(signer's response): got %x, want %x", sig2[32:32+encodingSize18*l44], sig[32:32+encodingSize18*l44])
		}
		if !bytes.Equal(sig2[lambda128/4+encodingSize18*l44:], sig[lambda128/4+encodingSize18*l44:]) {
			t.Errorf("signature mismatch(hint): got %x, want %x", sig2[lambda128/4+encodingSize18*l44:], sig[lambda128/4+encodingSize18*l44:])
		}
		pub, err := NewPublicKey44(pk)
		if err != nil {
			t.Fatalf("NewPublicKey44 failed: %v", err)
		}
		if !pub.VerifyPreHash(sig, msg, context, c.oid) {
			t.Error("signature verification failed")
		}
	}
}

